import { Component } from '@angular/core';
import { FormControl, Validators } from '@angular/forms';
import { FormBuilder, FormGroup } from '@angular/forms';



@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  
  searchControl = new FormControl();
  createForm: FormGroup;

  
  
  isAdd = false

  catList:any[] = [
    {
        "name": "แอปเปิ้ล",
        "photo": "data:image/jpeg;base64,"
    },
    {
        "name": "เชอร์รี่",
        "photo": "data:image/jpeg;base64,"
    },
    {
        "name": "แตงโม",
        "photo": "data:image/jpeg;base64,"
    }
]
  suggestList:any[] = [];

  constructor(  private fb: FormBuilder) {
    this.createForm = this.fb.group({
      name: ['',[Validators.required]],
      photo: ['',[Validators.required]],
    });
    this.buildForm()
  }


  buildForm(){

    this.suggestList = this.catList
    this.searchControl.valueChanges.subscribe(x => {
      if(x.length > 0){
         this.suggestWord(x);
      }else{
        this.suggestList = this.catList
      }
     
    });
    this.createForm = this.fb.group({
      name: ['',[Validators.required]],
      photo: ['',[Validators.required]],
    });
  }

  ngOnInit() {

    
  }

 

  suggestWord(txt:string){

    const list = this.catList;
    this.suggestList = list.filter((data:any) => 
    {
        let dataTxt = data.name.toLowerCase();
      
     return dataTxt.includes(txt.toLowerCase())});


}

handleUpload(event:any) {
  const file = event.target.files[0];
  const reader = new FileReader();
  reader.readAsDataURL(file);
  reader.onload = () => {
    this.createForm.controls["photo"].setValue(reader.result)
  };
}

onClickSave(){


  this.catList.push(this.createForm.getRawValue())
  this.suggestList = this.catList
  this.isAdd = false;  
  this.buildForm();
  console.log( this.catList);
  

}

onCancel(){
  this.buildForm();
  this.isAdd = false;
}



}
